import React, { useState } from "react";
import "./style.css";
const FormExample = () => {
  const [data, setData] = useState({
    firstName: "",
    EmailAddress: "",
    Passwords: "",
    PhoneNumber: "",
    Resume: "",
    checked: "",
  });

  const handlechange = (event) => {
    setData({ ...data, [event.target.name]: event.target.value });
  };

  const handlesubmit = (e) => {
    e.preventDefault();
    if (data.firstName === "") {
      alert("Enter the FirstName");
    } else if (data.EmailAddress === "") {
      alert("Enter the Emailaddress");
    } else if (data.Passwords === "") {
      alert("enter the password");
    } else if (data.PhoneNumber === "") {
      alert("enter the phonenumber");
    } else if (data.Resume === "") {
      alert("enter the resume");
    } else if (data.checked === "") {
      alert("enter the checked ");
    } else {
      alert("form Submitted");
    }
  };

  return (
    <div className="MainContainer">
      <form onSubmit={handlesubmit}>
        <div className="inputcontent">
          <label className="labelcontent">FirstName</label>
          <input
            type="text"
            name="firstName"
            value={data.firstName}
            onChange={handlechange}
          />
        </div>
        <div className="inputcontent">
          <label className="labelcontent">Email Address</label>
          <input
            type="email"
            name="EmailAddress"
            value={data.EmailAddress}
            onChange={handlechange}
          />
        </div>
        <div className="inputcontent">
          <label className="labelcontent">Password</label>
          <input
            type="text"
            name="Passwords"
            value={data.Passwords}
            onChange={handlechange}
          />
        </div>
        <div className="inputcontent">
          <label className="labelcontent">PhoneNumber</label>
          <input
            type="number"
            name="PhoneNumber"
            value={data.PhoneNumber}
            onChange={handlechange}
          />
        </div>
        <div className="inputcontent">
          <label className="labelcontent">Resume</label>
          <input
            type="file"
            name="Resume"
            value={data.Resume}
            onChange={handlechange}
          />
        </div>
        <div className="inputcontent">
          <label className="labelcontent">radio</label>
          <input
            type="radio"
            name="checked"
            value={data.checked}
            onChange={handlechange}
          />
        </div>
        <div>
          <label>CheckBox</label>
          <input
            type="checkbox"
            name="checked"
            value={data.checked}
            onChange={handlechange}
          />
        </div>
        <div>
          <label>Date&Time</label>
          <input
            type="date"
            name="date"
            value={data.date}
            onChange={handlechange}
          />
        </div>
        <div>
          <label>Date&Timelocal</label>
          <input
            type="datetime-local"
            name="datetime-local"
            value={data.datetime - local}
            onChange={handlechange}
          />
        </div>
        <div>
          <label>HiddenFile</label>
          <input
            type="hidden"
            name="hiddens"
            value={data.hiddens}
            onChange={handlechange}
          />
        </div>
        <div>
          <label>Iamges</label>
          <input
            type="image"
            name="images"
            value={data.images}
            onChange={handlechange}
          />
        </div>
        <div>
          <label>months</label>
          <input
            type="month"
            name="Months"
            value={data.Months}
            onChange={handlechange}
          />
        </div>
        <div>
          <label>range</label>
          <input
            type="range"
            name="ranges"
            value={data.ranges}
            onChange={handlechange}
          />
        </div>
        <div>
          <label>search</label>
          <input
            type="range"
            name="ranges"
            value={data.ranges}
            onChange={handlechange}
          />
        </div>
        <div>
          <button>submit</button>
        </div>
      </form>
    </div>
  );
};
export default FormExample;
